import 'package:get/get.dart';
import '../models/product.dart';

class ProductController extends GetxController {
  var products = <Product>[].obs;

  @override
  void onInit() {
    // Inicializar algunos productos de ejemplo
    products.addAll([
      Product('Agua', 2000 , "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRPmGrEXNzqRJ3qcOFjcCuKHYpcmzfl9SNdGw&s"),
      Product('Pepsi', 5000, "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS_GNecG-edHsSBPmbL181kuC5h2dPwXsUyGA&s"),
      Product('Pollo', 50000, "data:image/jpeg;base64,"),
      Product('Dorito', 5000, "data:image/jpeg;base64,"),
    ]);
    super.onInit();
  }

  void addProduct(String name, double price, String imagen) {
    products.add(Product(name, price, imagen));
    products.refresh();
  }
}
